import PropTypes from 'prop-types'


const Header = ({title}) => {
    return (
        <div>
            <header>
                <h1 style = {{color: 'red', backgroundColor: 'black'}}>{title}</h1>
            </header>
        </div>
    )
}

Header.defaultProps = {
    title: 'Task Tracker',
}

Header.propTypes = {
    title: PropTypes.string,
}
export default Header
